function Store() {
    return (
        <div class="grid grid-cols-4 gap-2 hover:col-span-6 h">
            {[
                Array.from(Array(9)).map((_, index) => (
                    <div
                        key={index}
                        className="p-4 rounded-lg shadow-lg bg-violet-500"
                    >
                        Product {index + 1}
                    </div>
                )),
            ]}
        </div>
    )
}

export default Store
